module vco_interface (
    input wire  i_vco_clk,                                                               //system clock
    input wire  i_vco_start,                                                             //system start signal
    input wire  reset,                                                                //system reset signal
    input wire  i_next_freq_req,
    

    output wire  o_vco_le,                                                                //Sampling Enable Signal
    output wire  o_vco_clk,                                                               //clock output signal
    output wire  o_vco_data,                                                               //data output signal
    //output wire  o_vco_freq_led ,                                                           // LED indicator for the frequncy shifting
    output wire o_vco_prog_done ,                                                         //indicating the programmig is done by VCO
    output wire [12:0] o_vco_freq                                                        //current frequency value
);                      
    //parameters                        
    parameter P_VCO_REG_COUNT               = 46;                                               //number of registers per frequency
    parameter P_VCO_FREQ_COUNT_DOWN         = 61;
    parameter P_VCO_FREQ_COUNT_UP           = 348;                                   //number of frequencies to sweep
    parameter P_VCO_REG_WAIT_TIME           = 10;                                               //wait time between registers
    parameter P_VCO_FREQ_WAIT_TIME          = 3_000_00;                                            //wait time between frequencies

    //states                        
    localparam IDLE         = 2'b00;                                                    //idle state
    localparam SEND         = 2'b01;                                                    //sending state
    localparam WAIT_REG     = 2'b10;                                                    //wait for register state
    localparam WAIT_FREQ    = 2'b11;                                                    //wait for frequency state
    
    //LUT
    reg [23:0] m_freq_data[P_VCO_FREQ_COUNT_UP* P_VCO_REG_COUNT - 1:0];                    //Hardcoded frequency Values

    //registers (counters)                      
    reg [31:0]  c_vco_bit_ctr;                                                           //counter for bits in each register
    reg [31:0]  c_vco_reg_ctr;                                                           //counter for registers in each frequency
    reg [31:0]  c_vco_freq_ctr;                                                          //counter for frequencies
    reg [31:0]  c_vco_reg_wait_ctr;                                                      //counter for wait time for registers
    reg [31:0] c_vco_freq_wait_ctr;                                                     //counter for wait time between frequencies
    reg [31:0] c_vco_prog_reg_ctr;                                                      //current transmitting register value
    reg [1:0]  c_vco_minor_ctr;
    //state
    reg [1:0]  r_vco_state;                                                             //current state
    reg [1:0]  r_vco_next_state;                                                        //next state

    //registers (flags)                     
    reg r_vco_reg_wait_done;                                                            //flag for wait time for registers
    reg r_vco_freq_wait_done;                                                           //flag for wait time between frequencies
    reg r_vco_bit_sending;                                                              //flag for sending bits
    reg r_vco_freq_sending;                                                             //flag for sending frequencies
    reg r_vco_freq_led;
    reg r_adc_vco_prog_done;
    reg [5:0]programmed_regs ;
    reg [12:0] r_vco_freq;                                                              //current frequency value
    //registers (outputs)
    reg r_vco_clk;
    reg r_vco_data;
    reg r_vco_le;
    reg led1;
    reg led2;
    reg led3;
    reg led4;

    assign o_vco_clk        = (r_vco_next_state == SEND) ?      r_vco_clk   : 1'b1;     //output clock signal
    assign o_vco_data       = (r_vco_next_state == SEND) ?      r_vco_data  : 1'b1;     //output data signal
    assign o_vco_le         = (r_vco_next_state == SEND) ?      r_vco_le    : 1'b1;
    //assign o_vco_freq_led   = r_vco_freq_led ;
    assign o_vco_prog_done   = r_adc_vco_prog_done;                                                //output programming done signal\
    assign o_vco_freq = (r_vco_freq< 286) ? (335 + 10 * r_vco_freq) : (295 - 5*(r_vco_freq-286));
                                                         //output frequency signal
    initial begin                       
    r_vco_le             <= 1'b1;                                    
    r_vco_clk            <= 1'b1;                       
    r_vco_data           <= 1'b1;                       

    c_vco_bit_ctr        <= 6'b0;                                               
    c_vco_reg_ctr        <= 6'b0;                       
    c_vco_freq_ctr       <= 9'b0;                                                                       
    c_vco_reg_wait_ctr   <= 10'b0;                                      
    c_vco_freq_wait_ctr  <= 32'b0;
    c_vco_prog_reg_ctr   <= 9'b0;
    c_vco_minor_ctr      <= 2'b0;                          

    r_vco_state          <= IDLE;                                                       //set state to idle
    r_vco_next_state     <= IDLE;                                                       //set next state to idle
    r_vco_reg_wait_done  <= 1'b0;
    r_vco_freq_wait_done <= 1'b1; 
    r_vco_bit_sending    <= 1'b0; 
    r_vco_freq_sending   <= 1'b0;
    r_vco_freq_led       <= 1'b0; 
    r_adc_vco_prog_done  <= 1'b0;
    r_vco_freq           <= 0;
    programmed_regs      <= 0;
    led1 <= 1'b0;
    led2 <= 1'b0;
    led3 <= 1'b0;
    led4 <= 1'b0;
    end

    always @( posedge i_vco_clk) begin
        c_vco_prog_reg_ctr  <= (c_vco_freq_ctr >> 1 ) * P_VCO_REG_COUNT   +  {c_vco_reg_ctr} ;
        r_vco_freq          <= c_vco_freq_ctr >> 1;
        if (reset) begin
            r_vco_state     <= IDLE;                                                    //set state to idle
        end else begin
            r_vco_state     <= r_vco_next_state;                                             //set state to next state
            case (r_vco_state)
                IDLE: begin
                    if (i_vco_start && r_vco_freq_wait_done && i_next_freq_req) begin
                        r_adc_vco_prog_done  <= 1'b0;
                        
                            if (c_vco_freq_ctr == P_VCO_FREQ_COUNT_UP*2) begin
                               r_vco_next_state      <= IDLE;                                  //set state to sending
                               c_vco_freq_ctr        <= 9'b0;                                    //reset frequency counter
                               r_vco_bit_sending     <= 1'b0; 
                            end else begin
                                r_vco_next_state      <= SEND;                                  //set state to sending
                                r_vco_bit_sending     <= 1'b1;
                            end                              //set bit sending flag to true
                       
                    end else begin
                        r_vco_next_state      <= IDLE;                                  //stay in idle state
                    end 
                end
                SEND: begin 
                    
                    c_vco_freq_wait_ctr  <= 32'b0;  
                    c_vco_reg_wait_ctr   <= 10'b0;
                    if (c_vco_minor_ctr == 1 && r_vco_next_state == SEND) begin
                          c_vco_bit_ctr       <= c_vco_bit_ctr + 1;
                          c_vco_minor_ctr     <= 0;   
                    end else if (r_vco_next_state == SEND)  begin
                          c_vco_minor_ctr   <= c_vco_minor_ctr + 1;
                    end else begin
                          c_vco_minor_ctr     <= 0; 
                    end                       
                    if (c_vco_bit_ctr == 24) begin 
                        c_vco_bit_ctr         <= 5'b0;                                  //reset bit counter
                        r_vco_next_state      <= WAIT_REG;                              //set state to wait for register
                        c_vco_reg_ctr         <= c_vco_reg_ctr + 6'b1;                  //increment register counter
                        r_vco_clk             <= 1'b1;
                        r_vco_bit_sending     <= 1'b0;
                        r_vco_le              <= 1'b1;   
                    end else begin 
                        if (r_vco_next_state  ==  WAIT_REG) begin
                            r_vco_clk         <= 1'b1;
                            r_vco_le          <= 1'b1;
                            
                        end else begin
                            r_vco_clk             <= ~r_vco_clk ;
                            r_vco_le              <= 1'b0;
                            
                        end       
                    end
                end

                WAIT_REG: begin
                
                    if (c_vco_reg_wait_ctr == P_VCO_REG_WAIT_TIME && c_vco_reg_ctr == P_VCO_REG_COUNT) begin
                        r_vco_reg_wait_done  <= 1'b1;                        //set wait done flag to true
                        r_vco_next_state     <= WAIT_FREQ;                   //set state to wait for frequency
                        
                        
                    end else if (c_vco_reg_wait_ctr == P_VCO_REG_WAIT_TIME ) begin
                        r_vco_reg_wait_done  <= 1'b1;                        //set wait done flag to true
                        r_vco_next_state     <= SEND;                        //stay in wait for register state
                        r_vco_bit_sending    <= 1'b1;
                               
                    end else begin
                        c_vco_reg_wait_ctr   <= c_vco_reg_wait_ctr + 1'b1;  //increment wait counter
                        r_vco_next_state     <= WAIT_REG;                   //stay in wait for register state
                    end 
                end

                WAIT_FREQ : begin
                c_vco_reg_wait_ctr           <= 10'b0;
                    
                        if (c_vco_freq_wait_ctr == P_VCO_FREQ_WAIT_TIME && c_vco_freq_ctr == P_VCO_FREQ_COUNT_UP*2) begin
                            r_vco_freq_wait_done <= 1'b1;                        //set wait done flag to true
                            r_vco_next_state     <= IDLE;                         //set state to idle
                            r_adc_vco_prog_done  <= 1'b1;
                        end else if (c_vco_freq_wait_ctr >= P_VCO_FREQ_WAIT_TIME ) begin
                            r_vco_next_state     <= IDLE;                   //stay in wait for frequency state
                            r_adc_vco_prog_done  <= 1'b1;
                            r_vco_bit_sending     <= 1'b1;
                            c_vco_reg_ctr        <= 6'b0;
                            c_vco_freq_ctr       <= c_vco_freq_ctr + 32'b1;         //increment frequency counter  
                            programmed_regs       <= programmed_regs + 1;
                            if (programmed_regs == 0) begin
                                r_vco_freq_led <= 1'b1;          
                            end else if (programmed_regs == 1) begin
                                led1 <= 1'b1;
                            end else if (programmed_regs == 2) begin
                                led2 <= 1'b1;
                            end else if (programmed_regs == 3) begin
                                led3 <= 1'b1;
                            end else if (programmed_regs == 4) begin
                                led4 <= 1'b1;
                            end 
                        end else begin
                            c_vco_freq_wait_ctr  <= c_vco_freq_wait_ctr + 32'b1; //increment wait counter
                            r_vco_next_state     <= WAIT_FREQ;                  //stay in wait for frequency state    
                        end 
                end
            endcase
        end
    end
            

    always  @(posedge r_vco_clk) begin

//        if (r_vco_bit_sending ) begin
//                          //increment bit counter 
//            c_vco_bit_ctr       <= c_vco_bit_ctr + 1;
//        end else begin
//                     c_vco_bit_ctr           <= 0;                                     //reset bit counter 
